        "listingDescription": "Valcom Properties is proud to present another amazing Townhouse perfect for investment or end-use. \n\nThe perfect balance of innovation and suburban charm, this delightful community is home to two- and three-bedroom tiered and standard townhouses that are connected by a network of walkways.\nThe community play areas delight children of all ages, while the parks are perfect for family picnics. And if it gets too warm or you’ve had a long day at work, a few laps in the swimming pool will have you refreshed in no time.\n\nClose to the urban core and community retail outlets, Urbana is minutes away from Al Maktoum International Airport and the Expo 2020 site, promising a world of convenience.\n\nEmaar South houses an amazing all-inclusive sports court including volleyball, basketball, and mini football.\n\nEmaar South is home to common outdoor kids’ play areas, each of which feature a number of exciting play equipment for junior residents.\nFor the adrenaline junkies among you- look no further than your community’s very own skate park! The park offers a selection of custom-built ramps which are plied with a special coating that offers amazing grip.\n\nEmaar South features miles of walking and cycling trails that meander throughout the community, taking residents through their own neighbourhoods and offering the chance to explore others too.\n\nWith 22,000 square meters of retail space, South Village is a community mall located in the Dubai South neighborhood. This leisure destination will offer a variety of dining spots, a comprehensive selection of service outlets, a pharmacy, dry cleaners, hair and beauty salon.\n\nThis Townhouse consists of 2 Bed Rooms and 2 bathrooms. Unfurnished, wide terrace and has one row, it has 2 Parks from the front and from the back it has an area square foot of 1,214 sqft and has 2 parking spaces available.",
