        "listingDescription": "Starz by Danube brings an innovative concept that enhances space utilization. A home that transforms as per your needs.  Starz offers a selection of 446 units of Studio, 1 and 2 bedroom fully furnished apartments. These apartments are fitted with modular furniture and a European technology convertible sofa, that transforms into a full size bed with just a gentle pull. Now you have a spacious living room by day and a comfortable additional bedroom at night.  If living at Starz is this comfortable, the location is even more convenient. Starz is located at Al Furjan - Dubai, next to Discovery Gardens; about 2 minutes away from the proposed metro line and just 10 minutes away from the Al Maktoum International Airport.\n\nCOMMUNITY\n\nAl Furjan is a local phrase for a collection of houses or a small village\nA contemporary and distinct family-oriented community\nOffers the comfort and warmth of traditional neighborhood living\nTerraced housing with abundant open spaces\nSet in 560 hectares of the Ibn Battuta Mall\nAdjacent to Discovery Gardens\nWhen complete, Al Furjan will feature over 4,000 homes\nRetail units\n\n\nLOCATION\n\nAl Furjan is a local phrase describing a collection of houses or a small village\nA contemporary and distinctly family oriented community, Al Furjan captures the principles of traditional neighborhood living, combining spacious villas and terraced housing with abundant open spaces and a multitude of amenities\nSet in 560 hectares of Ibn Battuta Mall and adjacent to Discovery Gardens and The Gardens, Al Furjan will feature over 4,000 homes\nStarz by Danube is located minutes away from the Dubai EXPO 2020 site. Starz is part of the many recent real estate developments in the new Dubai region\n2 mins from the new proposed metro line\n10 minutes away from the Al Maktoum International Airport\nNext to Discovery Gardens\nClose to Ibn Battuta Mall",
